import React , {useState , useContext } from 'react'
import { Appcontext } from '../App';




function AddStudent() {
    const [name, setName] = useState("");

    const {username , setUsername} = useContext(Appcontext)

    const handelsubmit =  (e) => {
        e.preventDefault();
        setUsername(name)
    }

  return (
    <>
        <h1>Add Student</h1>
        <h4>{username}</h4>
        <input type={'text'}   onChange={ e => setName(e.target.value)} placeholder="enter new username"  />
        <button className='btn btn-priamry'  onClick={ e => handelsubmit(e)}  > update username </button>

    </>
  );
}

export default AddStudent
